export default ({components, ...props}) => <MDXTag name="wrapper"  components={components}>
<MDXTag name="h1" components={components} props={{"id":"sidemenu"}}><MDXTag name="strong" components={components} parentName="h1">{`SideMenu`}</MDXTag></MDXTag>

